import React, { useState, useEffect } from "react";
import PropTypes from "prop-types";
import clsx from "clsx";
import { makeStyles } from "@material-ui/styles";
import {
  Card,
  CardContent,
  CardActions,
  Typography,
  Grid,
  TextField,
  Paper,
  Radio,
  RadioGroup,
  FormControlLabel,
} from "@material-ui/core";

const useStyles = makeStyles((theme) => ({
  root: {
      padding: theme.spacing(2)
  },
  imageContainer: {
    marginRight: 20,
    border: `1px solid ${theme.palette.divider}`,
    borderRadius: "5px",
    overflow: "hidden",
    display: "flex",
    alignItems: "center",
    justifyContent: "center",
    justifyItems: "center",
  },
  image: {
    width: "100%",
  },
  statsItem: {
    display: "flex",
    alignItems: "center",
  },
  statsIcon: {
    color: theme.palette.icon,
    marginRight: theme.spacing(1),
  },
}));

const Society = (props, disabled) => {
  const { className, product, components, display,...rest } = props;
  const classes = useStyles();
  const [civility, setCivility] = React.useState("mr");

  const handleChangeCivility = (event) => {
    setCivility(event.target.value);
  };

  return (

      <Grid container spacing={2}>

        <Grid item xs={12}>
          <TextField size="small" label="Raison social" variant="outlined" fullWidth disabled={!disabled}/>
        </Grid>
      </Grid>

  );
};

Society.propTypes = {
  className: PropTypes.string,
  product: PropTypes.object.isRequired,
};

export default Society;
